import React, { useState } from "react";
import { Link, useNavigate } from "react-router-dom";

const Navigate = () => {
  const [menuOpen, setMenuOpen] = useState(false);
  const navigate = useNavigate();

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
  };

  const closeMenu = () => {
    setMenuOpen(false);
  };

  const cart = () => {
    let user_id = localStorage.getItem("9ouenbcvgetywMhIOEJD") || "null";
    if (user_id === "null") {
      navigate("/login");
    } else {
      navigate("/cart");
    }
    closeMenu(); // Close menu after navigation
  };

  return (
    <>
      <div className="menubar">
        <img
          id="menuBar"
          src={
            menuOpen
              ? "https://cdn-icons-png.flaticon.com/128/10288/10288720.png"
              : "https://cdn-icons-png.flaticon.com/128/5036/5036960.png"
          }
          alt="Menu"
          onClick={toggleMenu}
        />
      </div>
      <nav className={`navigation ${menuOpen ? "open" : "closed"}`}>
        <h1 id="h1">Luxora</h1>
        <Link to="/" onClick={closeMenu}>
          Home
        </Link>
        <Link to="/signup" onClick={closeMenu}>
          Signup
        </Link>
        <Link to="/login" onClick={closeMenu}>
          Login
        </Link>
        <img
          src="https://cdn-icons-png.flaticon.com/128/4290/4290722.png"
          alt="cart"
          className="cart"
          onClick={cart}
        />
      </nav>
      <div className={`menus ${menuOpen ? "open" : "closed"}`}>
        <Link to="/" onClick={closeMenu}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/25/25694.png"
            alt="home"
          />
          <p>Home</p>
        </Link>
        <Link to="/signup" onClick={closeMenu}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/7542/7542128.png"
            alt="signup"
          />
          <p>Signup</p>
        </Link>
        <Link to="/login" onClick={closeMenu}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/14575/14575259.png"
            alt="login"
          />
          <p>Login</p>
        </Link>
        <Link to="/mobile" onClick={closeMenu}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/1551/1551353.png"
            alt="mobile"
          />
          <p>Mobile</p>
        </Link>
        <Link to="/laptop" onClick={closeMenu}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/99/99488.png"
            alt="laptop"
          />
          <p>Laptop</p>
        </Link>
        <Link to="/toys" onClick={closeMenu}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/3171/3171959.png"
            alt="Toys"
          />
          <p>Toys</p>
        </Link>
        <Link to="/cart" onClick={cart}>
          <img
            src="https://cdn-icons-png.flaticon.com/128/4290/4290722.png"
            alt="Cart"
          />
          <p>Cart</p>
        </Link>
        <a
          href="https://github.com/sivaprasath2004"
          target="_blank"
          rel="noopener noreferrer"
          onClick={closeMenu}
        >
          <img
            src="https://cdn-icons-png.flaticon.com/128/4460/4460756.png"
            alt="Support"
          />
          <p>Support</p>
        </a>
      </div>
    </>
  );
};

export default Navigate;

